import React from 'react';
import { format } from 'date-fns';
import '../styles/main.css';

interface OutfitPreviewProps {
  outfit?: {
    top?: string;
    bottom?: string;
    shoes?: string;
    accessories?: string[];
  };
}

export const OutfitPreview: React.FC<OutfitPreviewProps> = ({ outfit }) => {
  if (!outfit) {
    return (
      <div className="outfit-preview">
        <p className="text-center">No outfit selected</p>
      </div>
    );
  }

  return (
    <div className="outfit-preview">
      <div className="outfit-grid">
        {outfit.top && (
          <div className="outfit-item">
            <h3 className="outfit-item-title">Top</h3>
            <p className="outfit-item-name">{outfit.top}</p>
          </div>
        )}
        {outfit.bottom && (
          <div className="outfit-item">
            <h3 className="outfit-item-title">Bottom</h3>
            <p className="outfit-item-name">{outfit.bottom}</p>
          </div>
        )}
        {outfit.shoes && (
          <div className="outfit-item">
            <h3 className="outfit-item-title">Shoes</h3>
            <p className="outfit-item-name">{outfit.shoes}</p>
          </div>
        )}
        {outfit.accessories && outfit.accessories.length > 0 && (
          <div className="outfit-item">
            <h3 className="outfit-item-title">Accessories</h3>
            <ul className="outfit-accessories">
              {outfit.accessories.map((accessory, index) => (
                <li key={index}>{accessory}</li>
              ))}
            </ul>
          </div>
        )}
      </div>
    </div>
  );
};
